(1, 'Коммерческий бриф', 'Коммерческий бриф ориентирован на детальную проработку проектов для коммерческих объектов. В его рамках рассматриваются вопросы, связанные с функциональностью, зонированием, метражами, отделкой и техническими требованиями помещений. Вы указываете предпочтения по материалам, мебельной компоновке, освещению и системам кондиционирования, а также устанавливаете бюджет проекта. Такой бриф помогает разработать комплексное решение, отвечающее высоким стандартам эффективности, комфорта и эстетики, что особенно важно для коммерческих пространств.', 'Активный', 26, 'xBRPD9UR12H9L4h', NULL, NULL, NULL, NULL, '2025-07-25 07:14:26', '2025-07-25 07:14:26', 1, NULL, NULL, NULL, NULL, NULL, NULL);
