(326, 'Общий бриф', 'Общий бриф представляет собой структурированный опрос, направленный на выявление базовых предпочтений и потребностей клиента. Он включает вопросы о личных предпочтениях, функциональных особенностях помещения, количестве жильцов, а также об основных стилевых решениях. Заполнение этого брифа позволяет нам лучше понять ваш образ жизни и создать проект, который гармонично объединит практичность, уют и эстетическое единство интерьера.', 'Активный', NULL, 26, 'KlPMDFue1uTLsME', NULL, '2025-07-25 07:13:39', '2025-07-25 07:13:39', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
