(121, NULL, NULL, NULL, 'Старикова Анна Александровна', NULL, '+7 (927) 879-69-48', '114900', NULL, NULL, 'Планировка', NULL, NULL, 447, 83, 'hEoZLDVutprgV0ctUAxukpXwefgSYVre', '2025-06-11 08:13:40', NULL, NULL, '2025-06-04 08:13:40', NULL, '2025-06-09 11:26:52', 'Москва', NULL, NULL, NULL, 'Старикова Анна Александровна - заказала Экспресс эскизный дизайн-проект с рабочей документацией по тарифу 9-ком.кв. +79371166015 - Юрий (муж), необходимо добавить в чат.\r\n\r\n+7 917 702-29-35 Сергей (наш тех.руководитель), его необходимо добавить в чат разработки, он будет сопровождать техническую сторону разработки проекта и предоставит замеры   \r\n+7 917 713-96-97 Ольга (наш руководитель офлайн студии дизайна), она предоставит заполненный бриф и предварительную планировку.\r\n\r\n+7 917 705 8295 Дамир (наш SMM-специалист). Его нужно добавить в чат разработки. В процессе работы над проектом он будет использовать содержимое чата для создания контента, который способствует продвижению бренда «Экспресс Дизайн» в Йошкар-Оле.\r\n\r\nЗамеры предоставим мы.', NULL, 'Проект 9938,9939', NULL, 'экспресс эскизный проект с рабочей документацией', '9', NULL, NULL, 'Йошкар-Ола', 447, NULL, NULL, NULL, NULL, NULL, '2025-06-05', '42', '2025-08-03', 142, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Третий пакет 55% комиссия', 'партнер', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-04', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
