(202, NULL, NULL, NULL, 'Ахматгазизова Дарья Андреевна', NULL, '+7 (937) 939-60-10', '77900', NULL, NULL, 'Ждем ТЗ', NULL, NULL, 447, 447, 'c5eBBdp2t7LCi8yA7B10HKxoUfytAHuJ', '2025-06-27 09:22:46', NULL, NULL, '2025-06-20 09:22:46', NULL, '2025-06-20 09:22:46', NULL, NULL, NULL, NULL, 'Ахматгазизова Дарья Андреевна - заказала Экспресс рабочий дизайн-проект по тарифу 9-ком.кв. \r\n\r\n 89177040177 - Айрат (муж), необходимо добавить в чат. \r\n\r\n+7 917 702-29-35 Сергей (наш тех.руководитель), его необходимо добавить в чат разработки, он будет сопровождать техническую сторону разработки проекта и предоставит замеры  \r\n\r\n+7 917 713-96-97 Ольга (наш руководитель офлайн студии дизайна), она предоставит заполненный бриф и предварительную планировку.\r\n\r\n+7 917 705 8295 Дамир (наш SMM-специалист). Его нужно добавить в чат разработки. В процессе работы над проектом он будет использовать содержимое чата для создания контента, который способствует продвижению бренда «Экспресс Дизайн» в Йошкар-Оле.\r\n\r\nЗамеры предоставим мы.', NULL, NULL, NULL, 'экспресс рабочий проект', '9', NULL, NULL, 'Йошкар-Ола', 447, NULL, NULL, NULL, NULL, NULL, '2025-06-20', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Третий пакет 55% комиссия', 'партнер', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-20', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
